#define N 50
bool anagram(char* s, char* t){
    int a1[26]={0}, a2[26]={0};
    int i,j;
    while(*s && *t){
        i= *s - 'a';
        j= *t - 'a';
        a1[i] ++;
        a2[j] ++;
        s++;
        t++;
    }
    for(int k=0; k<26; k++){
        if(a1[k]!=a2[k]) return false;
    }
    return true;
}
int main() {

