    scanf("%s%s",s,t);
    if(strlen(s)!=strlen(t)){
        printf("%s and %s are Not Anagrams.");
    }
    else{
        if(anagram(s,t)){
            printf("%s and %s are Anagrams.",s,t);
        }
        else{
            printf("%s and %s are Not Anagrams.", s,t);
        }
       
    }
    return 0;
}

